class Prices extends React.Component {
  state = {
    currency: 'USD'
  }

  render() {
    return (
    <div>
        <h2 className={'sm:text-lg p-4 text-green-700'}> Bitcoin rate for: {this.props.bpi.bpi.USD.code}</h2>
        <ul>
          <li>
             {this.props.bpi.bpi.USD.symbol}{this.props.bpi.bpi.USD.rate}
          </li>
        </ul>
    </div>);
  }
}

export default Prices;
